BATMAN: GATES OF GOTHAM #4 (OF 5)

Written by SCOTT SNYDER and KYLE HIGGINS; Art and covers by TREVOR MCCARTHY

Batman, Red Robin, Robin and Black Bat are all thrown into a race against 
time as The Architect's true plan is revealed! But what does that mean for 
Oswald Cobblepot and Tommy Elliot? And just how does the first Super Villain 
of Gotham City factor into The Architect's plot to destroy the city's first 
families? Be here for the exciting penultimate issue!


